window.FrontEnd || (window.FrontEnd = {});
FrontEnd.LeadManagementServices = function() {
    var n = new CommonJS.Common,
        t = document.getElementById("staticDomain").getAttribute("data-msvrouter") ? document.getElementById("staticDomain").getAttribute("data-msvrouter") : "";
    this.LeadSourceAction = {
        SEND_ENQUIRY: "SEND_ENQUIRY",
        PHONE_REVEAL: "PHONE_REVEAL",
        EMAIL: "EMAIL",
        ZALO: "ZALO",
        SMS: "SMS"
    };
    this.LeadSourcePlatform = {
        BDS_WEB: "BDS_WEB",
        BDS_MOBILE_WEB: "BDS_MOBILE_WEB"
    };
    this.LeadSourcePage = {
        BDS_SEARCH_RESULT_PAGE: "BDS_SEARCH_RESULT_PAGE",
        BDS_LISTING_DETAILS_PAGE: "BDS_LISTING_DETAILS_PAGE",
        BDS_PROJECT_DETAILS_PAGE: "BDS_PROJECT_DETAILS_PAGE",
        BDS_HOME_PAGE: "BDS_HOME_PAGE",
        BDS_SAVED_LISTINGS_PAGE: "BDS_SAVED_LISTINGS_PAGE"
    };
    this.FromLeadType = {
        RequestCallBack: "REQUEST_CALL_BACK",
        PhoneReveal: "PHONE_REVEAL",
        SendEmail: "SEND_EMAIL",
        SendZalo: "SEND_ZALO",
        SendSMS: "SEND_SMS"
    };
    this.CreateLead = function(i) {
        return new Promise(function(r, u) {
            try {
                n.AjaxWrapperWithPromise({
                    type: "POST",
                    url: `${t}/Contacts/LeadManagement/CreateLead`,
                    data: i
                }).then(function(n) {
                    r(n)
                })
            } catch (f) {
                u(f)
            }
        })
    }
};